import React from 'react';
import Photo from './Photo/Photo';
import './Photos.css';

export default function Photos(props) {
  console.log("props.photos: " + JSON.stringify(props.photos, null, 4));
  return (
    <ul>
      {props.photos && (
        props.photos.map ((photo, index) =>
          <Photo 
            key={index}
            url={photo.url}
          />
        )
      )}
    </ul>
  )
}
